    duration: '',
    season_start: '',
    add: '',
    reduce: '',
    reduce_add: '',
    reduce_n: '',
    reduce_run_maxmissing: '',
    maxmissing: '',
    smry: '',
    smry_add: '',
    smry_n: '',
    smry_run_maxmissing: '',
    smry_only: '',
    normal: '',
    groupby: '',
    prec: '',
    meta: '',
    output: '',
    network: '',
  })
  const [ notdly, setNotdly ] = useState(false)
  const [ hasInterval, setHasInterval ] = useState(false)
  const [ hasElemsError, setHasElemsError ] = useState(false)

  const datafields = ['sids','county','climdiv','cwa','basin','state','bbox','sdate','edate','date','elems','meta','output']
  const elementKeys = Object.keys(datastate).filter(
    item => (!datafields.includes(item)
  ))

  const updateParam = (update) => {
    setDatastate({...datastate, ...update})
    props.updateInputParams(update)
  }

  const updateElemBuild = (update) => {
    setDatastate({...datastate, ...update})
  }
  const addElement = (event) => {
    const action = event.currentTarget.id   //"add" or "replace"
    const newElems = JSON.stringify(buildElement(elementKeys, datastate, action))
    setDatastate({...datastate, ...{elems: newElems}})
    props.updateInputParams({elems: newElems})
    props.updateHelpFor("")
  }

  const clearElements = () => {
    setDatastate({...datastate, ...{elems: ''}})
    props.updateInputParams({elems: ""})
    props.updateHelpFor("")
    setHasInterval(false)
    setHasElemsError(false)
  }

  const updateElems = (update) => {
    setDatastate({...datastate, ...update})
    try {
      JSON.parse(update.elems)
      setHasElemsError(false)
      props.updateInputParams(update)
    } catch {
      setHasElemsError(true)
    }
  }

  const checkHasInterval = (update) => {
    if (update.elems.length > 0) {
      try {
        let updateElems = JSON.parse(update.elems)
        let cond = false
        updateElems.forEach((ue) => {
          if (ue.hasOwnProperty('interval') && ue.interval.length) {
            cond = true
          }
        })
        if (cond !== hasInterval) {
          setHasInterval(cond)
        }
      } catch {
        console.log('Error parsing elems update: ' + update.elems)
      }
    } else {
      setHasInterval(false)
    }
  }

  // Update local variable storage whenever input_params updates
  useEffect(() => {
    let newstate= {}
    datafields.forEach((key) => {
      if (props.input_params.hasOwnProperty(key)) {
        if (key === 'elems' && typeof props.input_params.elems === 'object') {
          newstate= ({...newstate, ...{[key]: JSON.stringify(props.input_params.elems)}})
          checkHasInterval({[key]: JSON.stringify(props.input_params.elems)})
        } else {
          newstate= ({...newstate, ...{[key]: props.input_params[key]}})
        }
      } else {
        newstate = ({...newstate, ...{[key]: ''}})
      }
    })
    setDatastate({...datastate, ...newstate})
    // eslint-disable-next-line
  }, [props.input_params])

  // Check for change to notdly whenever duration or interval changes
  useEffect(() => {
    if (datastate.duration) {
      setNotdly((datastate.duration.length === 3 && datastate.duration !== 'dly') || 
        (datastate.duration.length > 0 && !isNaN(Number(datastate.duration)) && 
        (datastate.duration !== "1" || (datastate.interval !== 'dly' && !(datastate.interval.includes('[') && datastate.interval.length === 7)))))
    }
  }, [datastate.duration, datastate.interval])

  return (
    <div>
      <Grid container>
        <Grid item xs={4}>
          <Typography variant="h6">
            Required input
          </Typography>
          <Typography variant="caption">
            Enter id(s) for one of the following area types:
          </Typography>
          {datastate.cwacounty.length === 0 &&                
           datastate.sids.length === 0 &&
           datastate.bbox.length === 0 &&
            <RenderTextField
              id="state"
              fieldlabel="State"
              value={props.updateHelpforstate}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          {datastate.sids.length === 0 && 
           datastate.climdiv.length === 0 && 
           datastate.cwa.length === 0 && 
           datastate.basin.length === 0 && 
           datastate.state.length === 0 &&
           datastate.bbox.length === 0 &&
            <RenderTextField
              id="county"
              fieldlabel="County"
              value={props.updateHelpforcounty}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          {datastate.county.length === 0 && 
           datastate.sids.length === 0 && 
           datastate.cwa.length === 0 && 
           datastate.basin.length === 0 && 
           datastate.bbox.length === 0 &&
            <RenderTextField
              id="climdiv"
              fieldlabel="Climate Division"
              value={props.updateHelpforclimdiv}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          {datastate.county.length === 0 && 
           datastate.climdiv.length === 0 && 
           datastate.sids.length === 0 && 
           datastate.basin.length === 0 && 
           datastate.bbox.length === 0 &&
            <RenderTextField
              id="cwa"
              fieldlabel="CWA"
              value={props.updateHelpforcwa}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          {datastate.county.length === 0 && 
           datastate.climdiv.length === 0 && 
           datastate.cwa.length === 0 && 
           datastate.sids.length === 0 && 
           datastate.bbox.length === 0 &&
            <RenderTextField
              id="basin"
              fieldlabel="Basin"
              value={props.updateHelpforbasin}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          {datastate.county.length === 0 && 
           datastate.climdiv.length === 0 && 
           datastate.pcwa.length === 0 && 
           datastate.basin.length === 0 && 
           datastate.state.length === 0 &&
           datastate.sids.length === 0 &&
            <RenderTextField
              id="bbox"
              fieldlabel="Bounding box"
              value={props.updateHelpforbbox}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          {datastate.county.length === 0 && 
           datastate.climdiv.length === 0 && 
           datastate.cwa.length === 0 && 
           datastate.basin.length === 0 && 
           datastate.state.length === 0 &&
           datastate.bbox.length === 0 &&
            <RenderTextField
              id="sids"
              fieldlabel="Station IDs"
              value={props.updateHelpforsids}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateParam}
            />
          }
          <DateSelection
            sdate={props.updateHelpforsdate}
            edate={props.updateHelpforedate}
            date={props.updateHelpfordate}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateParam}
          />
          <RenderTextField
            id="elems"
            fieldlabel="Elements"
            value={props.updateHelpforelems}
            options={{style: {width:"90%"}, multiline: true, placeholder: "Enter directly or build using Element setup"}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElems}
          />
          {props.updateHelpforelems.includes("{") &&
            <Button 
              size="small"
              variant="outlined"
              style={{marginTop:"0.5em"}}
              onMouseDown={clearElements}
            >
              Clear elements
            </Button>
          }
          <QueryExplain
            input_params={props.input_params}
            wstype="StnData"
          />
        </Grid>

        <Grid item xs={4}>
          <Typography variant="h6">
            Optional element setup
          </Typography>
          <RenderTextField
            id="name"
            fieldlabel="Name"
            value={props.updateHelpforname}
            options={{}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElemBuild}
          />
          {props.updateHelpforname.includes("dd") &&
            <RenderTextField
              id="base"
              fieldlabel="Base"
              value={props.updateHelpforbase}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          <RenderTextField
            id="interval"
            fieldlabel="Interval"
            value={props.updateHelpforinterval}
            options={{disabled:hasInterval}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElemBuild}
          />
          <RenderTextField
            id="duration"
            fieldlabel="Duration"
            value={props.updateHelpforduration}
            options={{}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElemBuild}
          />
          {props.updateHelpforduration === 'std' &&
            <RenderTextField
              id="season_start"
              fieldlabel="Season start"
              value={props.updateHelpforseason_start}
              options={{required:true}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {!notdly &&
            <RenderTextField
              id="add"
              fieldlabel="Add"
              value={props.updateHelpforadd}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {notdly &&
            <RenderTextField
              id="reduce"
              fieldlabel="Reduce"
              value={props.updateHelpforreduce}
              options={{required:true}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {props.updateHelpforreduce.length > 0 && notdly &&
            <div>
              <RenderTextField
                id="reduce_add"
                fieldlabel="- Reduce Add"
                value={props.updateHelpforreduce_add}
                options={{style:{marginLeft:"2em"}}}
                updateHelpFor={props.updateHelpfor}
                updateParam={updateElemBuild}
              />
            </div>
          }
          {props.updateHelpforreduce.length > 0 && notdly &&
            <RenderTextField
              id="reduce_n"
              fieldlabel="- Reduce Number"
              value={props.updateHelpforreduce_n}
              options={{style:{marginLeft:"2em"}}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {props.updateHelpforreduce.includes("run") && notdly &&
            <RenderTextField
              id="reduce_run_maxmissing"
              fieldlabel="- Run max missing"
              value={props.updateHelpforreduce_run_maxmissing}
              options={{style:{marginLeft:"2em"}}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {notdly &&
            <RenderTextField
              id="maxmissing"
              fieldlabel="Max missing"
              value={props.updateHelpformaxmissing}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          <RenderTextField
            id="smry"
            fieldlabel="Summary"
            value={props.updateHelpforsmry}
            options={{}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElemBuild}
          />
          {props.updateHelpforsmry.length > 0 &&
            <div>
              <RenderTextField
                id="smry_add"
                fieldlabel="- Smry Add"
                value={props.updateHelpforsmry_add}
                options={{style:{marginLeft:"2em"}}}
                updateHelpFor={props.updateHelpfor}
                updateParam={updateElemBuild}
              />
            </div>
          }
          {props.updateHelpforsmry.length > 0 &&
            <RenderTextField
              id="smry_n"
              fieldlabel="- Smry Number"
              value={props.updateHelpforsmry_n}
              options={{style:{marginLeft:"2em"}}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {props.updateHelpforsmry.length > 0 && props.updateHelpforsmry.includes('run') &&
            <RenderTextField
              id="smry_run_maxmissing"
              fieldlabel="- Smry Max missing"
              value={props.updateHelpforsmry_run_maxmissing}
              options={{style:{marginLeft:"2em"}}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          {props.updateHelpforsmry.length > 0 &&
            <RenderTextField
              id="smry_only"
              fieldlabel="Summary only"
              value={props.updateHelpforsmry_only}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          <RenderTextField
            id="normal"
            fieldlabel="Normal"
            value={props.updateHelpfornormal}
            options={{}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElemBuild}
          />
          {props.updateHelpforinterval !== 'yly' &&
            <RenderTextField
              id="groupby"
              fieldlabel="Group by"
              value={props.updateHelpforgroupby}
              options={{}}
              updateHelpFor={props.updateHelpfor}
              updateParam={updateElemBuild}
            />
          }
          <RenderTextField
            id="prec"
            fieldlabel="Precision"
            value={props.updateHelpforprec}
            options={{}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateElemBuild}
          />

          {props.updateHelpforname.length > 0 &&
            <Button 
              id="add"
              size="small"
              variant="outlined"
              style={{marginTop:"0.5em"}}
              onMouseDown={addElement}
            >
              Add element
            </Button>
          }
          {props.updateHelpforname.length > 0 && props.updateHelpforelems.includes("{") &&
            <Button 
              id="replace"
              size="small"
              variant="outlined"
              style={{marginTop:"0.5em", marginLeft:"0.5em"}}
              onMouseDown={addElement}
            >
              Replace elements
            </Button>
          }
        </Grid>

        <Grid item xs={4}>
          <Typography variant="h6">
            Optional input
          </Typography>
          <RenderTextField
            id="meta"
            fieldlabel="Meta options"
            value={props.updateHelpformeta}
            options={{style: {width:"95%"}}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateParam}
          />
          <RenderTextField
            id="network"
            fieldlabel="Network"
            value={props.updateHelpfornetwork}
            options={{}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateParam}
          />
          <RenderTextField
            id="output"
            fieldlabel="Output type"
            value={props.updateHelpforoutput}
            options={{disabled: props.updateHelpformeta.length && props.updateHelpforoutput === 'json' ? true : false}}
            updateHelpFor={props.updateHelpfor}
            updateParam={updateParam}
          />
        </Grid>
      </Grid>
    </div>
  )
}

export default MultiStnDataInput
